  syntax:
    content: >-
      [IsoType("AbstractMemberType", IsAbstract = true, IsoType = IsoTypes.ComplexType)]

      [JsonObject("AbstractMemberType")]

      public abstract class AbstractMemberType : GmlObject, IModel, IObservableModel, INotifyPropertyChanged, IDbId, IOwnership
